.section {
    padding: 25px 0 5px;
    border-top: 1px dashed #EEEEEE;

    &:first-child {
        border-top: 0;
    }

    &-hd {
        padding-left: 10px;
        border-left: 3px solid #1890FF;
        font-weight: 500;
        font-size: 14px;
        line-height: 16px;
        color: #303133;
    }

    &-bd {
        display: flex;
        flex-wrap: wrap;
        margin-top: 20px;
    }

    .ivu-form-item {
        flex: 0 0 50%;
        margin-bottom: 20px;

        &:nth-child(odd) {
            padding-right: 48px;
        }

        &:nth-child(even) {
            padding-left: 48px;
        }
    }

    .ivu-date-picker {
        width: 100%;
    }

    .ivu-btn-text {
        color: #1890FF;

        &:focus {
            box-shadow: none;
        }
    }
}
